+-----------------+
|Sushi Bar Express|
+-----------------+

+----------------+
|Game Description|
+----------------+

In Sushi Bar Express you have to start a career as a Sushi chef and absorb all of the wise teachings of your master. He'll teach you how to slice, dice, roll and hammer sushi and serve it to customers as a delicious restaurant quality dish. Your customers are ordering different types of sushi and you need to keep upgrading your equipment and recipes in order to make a healthy profit before the day is over. In the cartoon style of some of the most popular casual games out in the market today you strive to be a master yourself one day!

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

- System: Windows XP/Vista/7

- CPU: 800 Mhz

- RAM: 128 MB

- Vcard: 32 MB w/ OpenGL 1.4 Support

- Scard: DirectX 9 Sound Card

